	@Test
	void makeIdURIs() throws URISyntaxException {
		RegionCoordinate region = RegionCoordinate.TEST_DABANG;
		List<Map<String, Double>> coordinates = dabang.makeCoordinates(region);
		
		
		List<URI> idURIs = dabang.makeIdURIs(coordinates);
		for(URI uri : idURIs) {
			System.out.println(uri.toString());
		}
		System.out.println(idURIs.size());
	}
	
	@Test
	void crawlRealEstateIds() throws URISyntaxException, ClientProtocolException, IOException, InterruptedException {
		RegionCoordinate region = RegionCoordinate.TEST_DABANG;
		List<Map<String, Double>> coordinates = dabang.makeCoordinates(region);
		List<URI> idURIs = dabang.makeIdURIs(coordinates);
		
		Set<String> ids = new LinkedHashSet<>();
		ids = dabang.crawlRealEstateIds(idURIs);
		for(String id : ids) {
			System.out.println(id);
		}
		System.out.println(ids.size());
		
		//error uri 테스트
		List<URI> errorURIs = new ArrayList<>();
		URI errorURI = new URI("aslkdjlk");
		errorURIs.add(errorURI);
		dabang.crawlRealEstateIds(errorURIs);
		
	}
	
